namespace PdfConverterApi.Controllers
{
    [ApiController]
    [Route("api/[controller]")]
    public class PdfConverterController :ControllerBase   {
        public string htmlContent = "";

        [HttpPost("convert")]
        public async Task<FileContentResult> ConvertHtmlToPdf([FromQuery] string url)
        {

            var pageSettings = new PageSettings(PaperFormat.FitPageToContent)
            {
                PaperWidth = 17,
                PaperHeight = 29,
                PrintBackground = true
            };

            using (var converter = new Converter())
            {
                converter.UseOldHeadlessMode = true;
                using (var writer = new MemoryStream())
                {
                    await converter.ConvertToPdfAsync(new ConvertUri(url), writer, pageSettings);
                    byte[] pdfBytes = writer.ToArray();

                    return File(pdfBytes, "application/pdf", "converted.pdf");
                };
            }
        }

